import React from 'react'
import InteractionPercentage from '../component/interaction-percentage/InteractionPercentage';
import InteractionTable from '../component/interaction-table/InteractionTable';
import NavBar from '../component/navbar/NavBar';

const Home = () => {
  return (
    <div style={{ display:"flex", flexDirection:"column", justifyContent:"center", height:"100vh", backgroundColor:"royalblue"}}>
        <NavBar />
        <InteractionPercentage />
    <div style={{ display:"flex", flexDirection:"column", justifyContent:"center", height:"70vh", backgroundColor:"rgba"}}> 
        <InteractionTable />
    </div>
    </div>
  )
}

export default Home;
